import React from 'react'
import Blog from './Blog'

const Blogs = ({ blogs }) => {
  // const filteredBlogs = blogs.filter(blog => blog.author.toUpperCase().indexOf(filterValue.toUpperCase()) >= 0)
  const blogList = blogs.map(blog =>
  <Blog
    key={ blog.id }
    id={ blog.id }
    title={ blog.title }
    author={ blog.author }
    likes={ blog.likes }
    url={ blog.url }
    name={ blog.user.name }
  />)
  return(
      <div>{blogList}</div>
  )
}

export default Blogs
